description:
Clark as a tourist finds Aladdin's lamp, rubs it and the genie fulfills all his sexual desires. Clark gets three wishes and you can only imagine the sexual shenanigans and action that soon occurs! First with a belly dancer, then with an insatiable nymphomaniac, then with two women, the Genie also allows him to have a fourth wish, that of playing with four women simultaneously. By now Aladdin too has become insatiable, and he wants to make love with 100 women at the same time, but the Genie refuses this last wish of his, and Aladdin suddenly returns to reality, ready to continue his travel on the search for new and exciting experiences.

